import React from "react";
import { useState } from "react";
import { Container, Group, Burger } from "@mantine/core";
import { useDisclosure } from "@mantine/hooks";
import classes from "./HeaderMenu.module.css";

import {
  IconNotification,
  IconCode,
  IconBook,
  IconChartPie3,
  IconFingerprint,
  IconCoin,
  IconChevronDown,
} from "@tabler/icons-react";

// const links = [
//   { link: "/home", label: "Home" },
//   { link: "/global", label: "Global" },
//   { link: "/category", label: "Category" },
//   { link: "/product-list", label: "Product List" },
//   { link: "/cart", label: "Cart" },
//   { link: "/profile", label: "Profile" },
//   { link: "/settings", label: "Settings" },
// ];

const links = [
    {
      link: "#1",
      icon: <IconHome2 />,
      label: "Home",
      links: [
        { link: "/docs", label: "Documentation" },
        { link: "/resources", label: "Resources" },
        { link: "/community", label: "Community" },
        { link: "/blog", label: "Blog" },
      ],
    },
    {
      link: "#2",
      icon: <IconWorld />,
      label: "Global",
      links: [
        { link: "/app-bar", label: "App Bar" },
        { link: "/nav-bar", label: "Nav Bar" },
        { link: "/drawer", label: "Drawer" },
        // { link: "/side-bar", label: "Side App Bar" },
      ],
    },
    {
      link: "#3",
      icon: <IconCategory />,
      label: "Category",
      links: [
        { link: "/docs", label: "Documentation" },
        { link: "/resources", label: "Resources" },
        { link: "/community", label: "Community" },
        { link: "/blog", label: "Blog" },
      ],
    },
    {
      link: "#4",
      icon: <IconDatabase />,
      label: "Product List",
      links: [
        { link: "/docs", label: "Documentation" },
        { link: "/resources", label: "Resources" },
        { link: "/community", label: "Community" },
        { link: "/blog", label: "Blog" },
      ],
    },
    {
      link: "#5",
      icon: <IconGardenCart />,
      label: "Cart",
      links: [
        { link: "/docs", label: "Documentation" },
        { link: "/resources", label: "Resources" },
        { link: "/community", label: "Community" },
        { link: "/blog", label: "Blog" },
      ],
    },
    {
      link: "#6",
      icon: <IconTruckDelivery />,
      label: "Order",
      links: [
        { link: "/docs", label: "Documentation" },
        { link: "/resources", label: "Resources" },
        { link: "/community", label: "Community" },
        { link: "/blog", label: "Blog" },
      ],
    },
    {
      link: "#7",
      icon: <IconUser />,
      label: "Profile",
      links: [
        { link: "/docs", label: "Documentation" },
        { link: "/resources", label: "Resources" },
        { link: "/community", label: "Community" },
        { link: "/blog", label: "Blog" },
      ],
    },
    {
      link: "#8",
      icon: <IconSettings />,
      label: "Settings",
      links: [
        { link: "/docs", label: "Documentation" },
        { link: "/resources", label: "Resources" },
        { link: "/community", label: "Community" },
        { link: "/blog", label: "Blog" },
      ],
    },
  ];

const HeaderMenu = () => {
  const [opened, { toggle }] = useDisclosure(false);
  const [active, setActive] = useState(links[0].link);

  const items = links.map((link) => (
    <a
      key={link.label}
      href={link.link}
      className={classes.link}
      data-active={active === link.link || undefined}
      onClick={(event) => {
        event.preventDefault();
        setActive(link.link);
      }}
    >
      {link.label}
    </a>
  ));

  return (
    <header className={classes.header}>
      <Container size="xl" bg="indigo.6" className={classes.inner}>
        <Group ml="lg" gap={5} visibleFrom="xs">
          {items}
        </Group>

        <Burger opened={opened} onClick={toggle} hiddenFrom="xs" size="sm" />
      </Container>
    </header>
  );
};

export default HeaderMenu;
